import React from 'react';

export default function Home() {
  return (
    <section>
      <h2>Bem-vindo à SmileCare</h2>
      <p>Sorria com confiança! Nossa clínica oferece tratamentos modernos para cuidar do seu sorriso.</p>
    </section>
  );
}
